<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Fractal Tree Android Shim</title>
    <script>
        // Called by the code execution engine, will replace the entire DOM
        window.replaceDOM = (newCode) => {
            document.open('text/html');
            document.write(newCode);
            document.close();
            setTimeout(() => {
                var loadEvent = document.createEvent('Event');  
                loadEvent.initEvent('load', false, false);  
                window.dispatchEvent(loadEvent);
            }, 0);
        }

        setTimeout(() => replaceDOM(atob(`%APP_CODE_B64%`)), 1500)
    </script>
    <style>

        body {
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            animation: fadeIn 0.5s ease 0s 1 normal forwards;
        }

        body > .poweredBy {
            width: 80%;
            height: auto;
            display: flex;
            margin-top: auto;
            margin-bottom: 3rem;
        }

        body > .splashMain {
            border: 10px solid #ff5b94;
            width: 75%;
            aspect-ratio: 1;
            margin-top: auto;
            margin-bottom: auto;
            border-radius: 100%;
            background-size: cover;
            background-position: center;
            display: flex;
            justify-content: center;
            align-items: center;
            overflow: hidden;
        }

        body > .splashMain > .splashIcon {
            width: 130%;
            height: 130%;
            filter: drop-shadow(0 0 0.75rem rgba(0, 0, 0, 0.582));
        }

        @keyframes fadeIn {
            0% { opacity: 0; }
            100% { opacity: 1; }
        }
    </style>
</head>
